import React, { Component } from 'react'

class Debits extends Component {
  render() {
    const { debits } = this.props

    const drawTable = () => {
      debits.map(debit => {
        return (
            <tr>
              <td>{debit.date}</td>
              <td>{debit.description}</td>
              <td>{debit.amount}</td>
          </tr>
        )
      })
    }

    return (
      <section>
        <h1>Debits</h1>

        <table>
          <tr>
            <th>Date</th>
            <th>Description</th>
            <th>Amount</th>
          </tr>
          {drawTable()}
        </table>
      </section>
    )
  }
}

export default Debits
